// App.js
import React, { useState } from 'react';
import './App.css';

function App() {
  const [selectedContent, setSelectedContent] = useState('');

  // Content data could be an object mapping keys to their respective content
  const contentData = {
    output1: 'Params Diff Content',
    output2: 'Logged Messages Content',
    output3: 'FW Diff Content',
    output4: 'Crash Time Content',
  };

  const handleButtonClick = (contentKey) => {
    setSelectedContent(contentKey);
  };

  return (
    <div className="App">
      <div className="sidebar">
        <button onClick={() => handleButtonClick('output1')}>Params Diff</button>
        <button onClick={() => handleButtonClick('output2')}>Logged Messages</button>
        <button onClick={() => handleButtonClick('output3')}>FW Diff</button>
        <button onClick={() => handleButtonClick('output4')}>Crash Time</button>
      </div>
      <div className="content">
        {selectedContent && <div>{contentData[selectedContent]}</div>}
      </div>
    </div>
  );
}

export default App;
